@Override public SubtitleDecoder createDecoder(Format format){
  @Nullable String mimeType=format.sampleMimeType;
  if (mimeType != null) {
switch (mimeType) {
case MimeTypes.TEXT_VTT:      return new WebvttDecoder();
case MimeTypes.TEXT_SSA:    return new SsaDecoder(format.initializationData);
case MimeTypes.APPLICATION_MP4VTT:  return new Mp4WebvttDecoder();
case MimeTypes.APPLICATION_TTML:return new TtmlDecoder();
case MimeTypes.APPLICATION_SUBRIP:return new SubripDecoder();
case MimeTypes.APPLICATION_TX3G:return new Tx3gDecoder(format.initializationData);
case MimeTypes.APPLICATION_CEA608:case MimeTypes.APPLICATION_MP4CEA608:return new Cea608Decoder(mimeType,format.accessibilityChannel);
case MimeTypes.APPLICATION_CEA708:return new Cea708Decoder(format.accessibilityChannel,format.initializationData);
case MimeTypes.APPLICATION_DVBSUBS:return new DvbDecoder(format.initializationData);
case MimeTypes.APPLICATION_PGS:return new PgsDecoder();
default:break;
}
}
throw new IllegalArgumentException("Attempted to create decoder for unsupported MIME type: " + mimeType);
}
